function getCookie(n, v) {
    var a = document.cookie.split("; ");
    for (var i = 0; i < a.length; i++) {
        if (a[i].split("=")[0] == n) {
            return (a[i].substring(a[i].indexOf("=") + 1)).replace(/\"/g, "")
        }
    }
    return v || '';
}
function setCookie(n, v) {
    var d = 30;
    var e = new Date();
    e.setTime(e.getTime() + d * 24 * 60 * 60 * 1000);
    if (n == "backUrl") {
        deleteCookie("backUrl")
    }
    if(webRoot.indexOf(".benlai.com")>-1) {
        document.cookie = n + "=" + escape(v) + ";expires=" + e.toGMTString() + ";path=/;domain=.benlai.com"
    }else{
        document.cookie = n + "=" + escape(v) + ";expires=" + e.toGMTString() + ";path=/"
    }
}
